import React from "react";
import {
    Text,
    View,
    Image,
    StyleSheet,
    ScrollView,
    TouchableOpacity,
} from 'react-native';
import {icons, FONTS, SIZES, COLORS} from "../constant";

const Product = ({route,navigation}) =>{
    const [shoe, setShoe] = React.useState(null);
    React.useEffect(() => {
        let {shoe} = route.params;
        setShoe(shoe)
    }, [])
        return (
            <View style={styles.container}> 
                <View style={{height:110,width:'100%', backgroundColor:COLORS.white, flexDirection:'row'}}>
                    <TouchableOpacity style={{marginLeft:20,top:'15%'}} onPress={() => navigation.goBack()}>
                        <Image  source={icons.back} resizeMode='cover' style={{height:15,width:25}} />
                    </TouchableOpacity>
                    <Text style={{fontSize:15, top:'15%', marginLeft:30}}>Release</Text>
                </View>
                <View style={{height:550,backgroundColor:'violet'}}>
                
                </View>
            </View>
    )
}
const styles= StyleSheet.create({
    container: {
        flex:1,
        flexDirection:'column'
    }
});
export default Product;
